'''The Ancient Prison''' is a [[music]] track that is unlocked in the [[Ancient Prison]], and requires completion of the [[miniquest]] [[The Frozen Door]] to unlock.

==Trivia==
*The track was originally released on 3 December 2009, being played during the quest {{RSL|The Temple at Senntisten}} in ''{{RSL|RuneScape}}'' and later in the Ancient Prison. It was originally composed by Chris Jolley, and was titled "{{RSL|Zaros Stirs}}".

